import dados from './dado';
import '../design/lista.css';

function lista() {
   return (
      <div className="appLista">
         <header className="appBarLista">
            <ul className="listLista">
               <li className="elemlistLista"><a href="/">Graficos</a></li>
               <li className="elemlistLista" id="elemlistListaDois"><a href="/cliente">Cadastrar Novos Usuarios</a></li>
               <li className="elemlistLista"><a href="/lucros">Lucros</a></li>/
            </ul>
         </header>
         <main className="mainLista">
            <div className="lista">
               {dados.map((items) =>(<div className="ficha"><p className="p">Nome do Cliente: </p><p className="p">{items.userclientes}</p><p className="p">Identifica√ß√£o do Cliente: </p><p className="p">{items.usinaid}</p><p className="p">Participa√ß√£o na Usina: </p><p className="p">{items.perctparticipacao}</p><button className="apagaCliente">üóëÔ∏è</button></div>))}
            </div>
         </main>
      </div>
   )
}
export default lista;
